import React from 'react';
import ISidebar from '../../interfaces/ISidebar';

interface Props {
  sidebar: ISidebar;
}

const Sidebar = ({ sidebar: { title, logoPath } }: Props) => {
  return (
    <>
      <div>
        <img className="" src={logoPath} alt="logo" />
        {title}
      </div>
    </>
  )
}

export default Sidebar;
